window.bookSummaryJSON = "<p>A mysterious object threatens to destroy our solar system. The survival of humankind is at risk, but nobody takes the warning of young astrophysicist Maribel Pedreira seriously. At the same time, an exiled crew of outcasts mines for rare minerals on a lone asteroid.&nbsp;&nbsp;&nbsp;</p> <p>When other scientists finally acknowledge Pedreira's alarming discovery, it becomes clear that these outcasts are the only ones who may be able to save our world, knowing that the Hole hurtles inexorably toward the sun.</p>"; 
